‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî‚ÄîRECIPE‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî‚Äî
Ingredients~ 
200 gm chicken breast 
200 gm carbs (Roti or Rice, I added 2 roti) 
1 onion 
1 tomato 
1 capsicum 
4 garlic clove 
1/2 lemon 
1 teaspoon turmeric 
1 teaspoon paprika
1 teaspoon garlic powder 
1 teaspoon onion powder 
25 gm low fat hung curd 

Preparation~ 
For marination, add curd, turmeric, garlic powder, onion powder, paprika, salt, lemon juice in a bowl, mix and now add boiled chicken breast (cut into pieces) leave it in a refrigerator for at least 6 hours. 
For gravy, In a mixer add onion, tomato, roasted garlic cloves, make a paste 
In a nonstick pan add half tablespoon olive oil then add your marinated chicken breast, grill until charcoal texture. 
Take a wok add 1 tablespoon olive oil add onion tomato pate, add some water and cook it with lid on for 3 to 4 minutes. 
Lid off and add capsicum (diced) mix it wait for a minute and now add your chicken breast, add 3/4 cup water (100ml-150ml) cover it with lid and cook for 10 to 15 minutes on a low flame. 
Check and add salt, if you want thicker gravy cook it without lid for additional 3 to 5 minutes. 
Enjoy with rice or roti ü•∞

700 approx total calories 
66 gm protein 
48 gm carbs 
25 gm fat 

